using namespace std;

class Soluttion
{
public:
  /**
   * 算法描述：
   * 定义一个向量，记录目前找到到的所有子串。
   * 对比过程如下：
   * 先将起始的字符添加进一个向量，然后，依次从该字符的下一位开始，
   * 只要当前要比较的字符没有出现在该向量中，就将其添加到该向量中。
   * 循环终止条件：
   * 1. 当前被比较的字符已经出现过。
   * 2. 循环正常结束。
   */
  int lengthOfLongestSubstring(string s) {

    int len = s.size();
    if (s.size() <= 1)
      return 0;
    
    vector<vector<char>>  results;
    for (int i = 0; i < len - 1; ++i) {
      vector<char> substr;
      substr.push_back(s[i]);

      for (int j = i + 1; j < len; ++j) {
	//该字符已经存在
	if (find(substr.begin(), substr.end(), s[j]) != substr.end() )
	  break;
	substr.push_back(s[j]);
      }

      if (substr.size() < len)
	results.push_back(substr);
      else
	return len;
    }

    auto answer= *max_element(results.begin(), results.end(), [] (vector<char> elem1, vector<char> elem2) {
	return elem1.size()  < elem2.size();
      });

    for (auto &c : answer)
      cout<<c;
    cout<<endl;

    return answer.size();
	 
  }


  int lengthOfLongestSubstring2(string s) {

    int len = s.size();
    if (s.size() == 1)
      return 1;

    if (s.size() == 0)
      return 0;

    int maxSubLen = 0;
    
    for (int i = 0; i < len - 1; ++i) {
      vector<char> substr;
      substr.push_back(s[i]);

      for (int j = i + 1; j < len; ++j) {
	//该字符已经存在
	auto pos = find(substr.begin(), substr.end(), s[j]);
	if (pos != substr.end()) {
	  // if (j < len - 2 && *(pos + 1) == s[j + 1])
	  // i = j;
	  break;
	}

	substr.push_back(s[j]);
      }

      if (maxSubLen < substr.size()) {
	maxSubLen = substr.size();
	//i += maxSubLen;
      }
    }

    return maxSubLen;
    

  }

  /**
   *  tail记录last position of the current repeainted char. 
   */
  
  int lengthOfLongestSubstring3(string s) {

    if (s.length() == 0)
      return 0;

    map<char, int> charTailMap;

    int length = 0;
    int tail = -1;
    for (int i = 0; i < s.length(); ++i) {
      for (auto &elem :  charTailMap) {
	if (elem.first == s[i]) {
	  tail = tail > elem.second ? tail : elem.second;
	  cout<<"tail = "<<tail<<endl;
	}
      }
      
      length = length > i - tail ? length : i - tail;
      charTailMap[s[i]] = i;
      cout<<"length = "<<length<<endl;
      
    }

      return length;
  }
  
  
};


